import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from '/media/hp/107 GB Volume/WebDev/Projects/giftbazar/src/Pages/Home.js';
import ComingSoon from './Pages/ComingSoon/ComingSoon.js';

function App() {
  return (
    <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/buynow" element={<ComingSoon />} />
    </Routes>
  );
}

export default App;
